import React from "react";

const props = {
    "Name": "Athlete-Name",
    "Date": "Date",
    "averageScore": {
        "Monday": "dataMonday",
        "Tuesday": "dataTuesday",
        "Wednesday": "dataWednesday",
        "Thursday": "dataThursday",
        "Friday": "dataFriday",
        "Saturday": "dataSaturday",
        "Sunday": "dataSunday"
    },
    "weeklyAverage": 0
}

function Athlete({props}) {
    return (
        <div className="Athlete">
            <h1>{props.name}</h1>
            <h2>{props.date}</h2>
        </div>
    )
}

export default Athlete;
